import React, { useState } from 'react';

const Form = () => {
  const [login, setLogin] = useState('');
  const [password, setPassword] = useState('');
  const [birthdate, setBirthdate] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [isNewUser, setIsNewUser] = useState(true);

  const handleSubmit = (event) => {
    event.preventDefault();
    // Submit the form data to the server or do some other action.
  };

  return (
    <div>
      <h2>{isNewUser ? 'Créer un compte' : 'Se connecter'}</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="email">Adresse e-mail</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(event) => setLogin(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="password">Mot de passe</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(event) => setPassword(event.target.value)}
            required
          />
        </div>
        {isNewUser && (
          <div>
            <label htmlFor="birthdate">Date de naissance</label>
            <input
              type="date"
              id="birthdate"
              value={birthdate}
              onChange={(event) => setBirthdate(event.target.value)}
              required
            />
          </div>
        )}
        {isNewUser && (
          <div>
            <label htmlFor="confirmPassword">Confirmer le mot de passe</label>
            <input
              type="password"
              id="confirmPassword"
              value={confirmPassword}
              onChange={(event) => setConfirmPassword(event.target.value)}
              required
            />
          </div>
        )}
        <button type="submit">{isNewUser ? 'Créer un compte' : 'Se connecter'}</button>
      </form>
      <div>
        <button onClick={() => setIsNewUser(!isNewUser)}>
          {isNewUser ? 'Se connecter' : 'Créer un compte'}
        </button>
      </div>
    </div>
  );
};

export default Form;
